"use strict";

const { default: Deque } = require("collections/deque");
const { default: defaultdict } = require("collections/defaultdict");

function f_gold(numCourses, prerequisites) {
    const edges = defaultdict(Array);
    const indegree = Array(numCourses).fill(0);
    for (const [a, b] of prerequisites) {
        edges[b].push(a);
        indegree[a] += 1;
    }
    const q = new Deque();
    for (let i = 0; i < numCourses; i++) {
        if (indegree[i] === 0) {
            q.push(i);
        }
    }
    let n = 0;
    while (q.length > 0) {
        const b = q.shift();
        n += 1;
        for (const a of edges[b]) {
            indegree[a] -= 1;
            if (indegree[a] === 0) {
                q.push(a);
            }
        }
    }
    return n === numCourses;
}
